const createCompress = require('compress-brotli')
const {
    constants: {
      BROTLI_MODE_TEXT,
      BROTLI_PARAM_MODE,
      BROTLI_PARAM_QUALITY
    }
  } = require('zlib')

// It exposes compress/decompress methods
const { compress, decompress } = createCompress({
    compressOptions: {
      chunkSize: 1024,
      parameters: {
        [BROTLI_PARAM_MODE]: BROTLI_MODE_TEXT
      }
    },
    decompressOptions: {
      chunkSize: 1024,
      parameters: {
        [BROTLI_PARAM_MODE]: BROTLI_MODE_TEXT
      }
    }
  })





// Override call level options (deep merge for parameters)
const data = ''
compress(data)
    .then((result) => {
        console.log(result, "==compredd")
        let bufStr = result.toString('base64')
        console.log(bufStr.length, "==bufstr")
        var buf = Buffer.from(bufStr, 'base64');
        return decompress(buf)
    })
    .then((decompr)=>{
        // console.log(decompr, "==decompre")
        console.log(decompr == data, data.length)
    })
    .catch(error => {
        console.log(error, "==errror")
    })